pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import "../interfaces/IProofOfHumanity.sol";

contract MainContract {

    struct Comment {
        address user;
        string text;
    }

    struct Image {
        string url;
        string description;
        address owner;
        uint uploadDate;
        bool isVotationOpen;
        address[] assignedVoters;
        address[] positiveVotes;
        address[] negativeVotes;
        Comment[] comments;
    }

    struct User {
        address _address;
        string name;
        string profilePicUrl;
        uint validatorReputation;
        uint creatorReputation;
        uint tokens;
    }

    enum Vote {POSITIVE, NEGATIVE}

    /* ---------------------------------- CONSTANTS ---------------------------------- */

    uint constant ASSIGNED_VOTERS = 10;

    uint constant MAX_VOTERS = 5;

    uint constant PUBLISH_COST = 1;

    uint constant VOTE_COST = 1;

    uint constant VERIFY_REWARD = 2;

    uint constant STARTING_TOKENS = 1000;

    // /* ---------------------------------- VARIABLES ---------------------------------- */

    IProofOfHumanity public proofOfHumanity;

    address ownerAddress;

    address[] private usersAddresses;

    mapping(address => User) private users;

    string[] private imageUrls;

    mapping(string => Image) private images;

    /* ---------------------------------- GENERIC FUNCTIONS ---------------------------------- */

    function _getRandomSubset(address[] memory array, uint n) private view returns (address[] memory) {
        address[] memory subset = new address[](n);
        uint rand = uint(keccak256(abi.encode(block.timestamp, block.difficulty))) % array.length;

        for (uint i = 0; i < n; i++)
            subset[i] = array[(i + rand) % array.length];

        return subset;
    }

    function fillDummyUsers() public {
        usersAddresses = [0x81Ffa73300Aa2c025d576711363b7466DFecd942, 0xa8b505C0C47f44FA9B520F8B9eC68D843cBD9fB0, 0x9c7A2Af7a9CBcB642D9F10F38DB9dc0C306F5fdB, 0xE741FB345D935D47B876555b2f19280345C58b77, 0xB8a69D9292e22194824225784d8521e3e0929d84, 0xb4934B4Fd74d3877DFfe8e3dBb2b6f659EEBa323, 0x1a26F4C6693a01c14e93A26220544D0e17dB5B2A, 0x534505EdCa429fF8244DfD20bf6c4Aae61B3dC00, 0x702b2975b3b42c82A4d3aa1E2040Ce05E6751F73];
        users[0x335c33Cfd1bB79B09946EF25EB99Cb0f9BA8980c] = User(0x335c33Cfd1bB79B09946EF25EB99Cb0f9BA8980c, 'Matias Apablaza', '', 80, 89, 69);
        users[0x81Ffa73300Aa2c025d576711363b7466DFecd942] = User(0x81Ffa73300Aa2c025d576711363b7466DFecd942, 'Agustin Dagostino', '', 70, 77, 70);
        users[0xa8b505C0C47f44FA9B520F8B9eC68D843cBD9fB0] = User(0xa8b505C0C47f44FA9B520F8B9eC68D843cBD9fB0, 'Agustina Macciavelli', '', 80, 91, 85);
        users[0x9c7A2Af7a9CBcB642D9F10F38DB9dc0C306F5fdB] = User(0x9c7A2Af7a9CBcB642D9F10F38DB9dc0C306F5fdB, 'Mika Dadi', '', 83, 80, 64);
        users[0xE741FB345D935D47B876555b2f19280345C58b77] = User(0xE741FB345D935D47B876555b2f19280345C58b77, 'Vitalik Butherin', '', 92, 92, 68);
        users[0xB8a69D9292e22194824225784d8521e3e0929d84] = User(0xB8a69D9292e22194824225784d8521e3e0929d84, 'Johan Steven', '', 81, 58, 75);
        users[0xb4934B4Fd74d3877DFfe8e3dBb2b6f659EEBa323] = User(0xb4934B4Fd74d3877DFfe8e3dBb2b6f659EEBa323, 'Michael Wall', '', 79, 88, 92);
        users[0x1a26F4C6693a01c14e93A26220544D0e17dB5B2A] = User(0x1a26F4C6693a01c14e93A26220544D0e17dB5B2A, 'Jennifer Win', '', 63, 69, 33);
        users[0x534505EdCa429fF8244DfD20bf6c4Aae61B3dC00] = User(0x534505EdCa429fF8244DfD20bf6c4Aae61B3dC00, 'Alice Bay', '', 98, 99, 16);
        users[0x702b2975b3b42c82A4d3aa1E2040Ce05E6751F73] = User(0x702b2975b3b42c82A4d3aa1E2040Ce05E6751F73, 'Rachel Dan', '', 86, 91, 35);
    }

    function fillDummyImages() public {
        imageUrls = ["https://images.unsplash.com/photo-1679943087717-1baf25721d73?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTY4MDM5MzY2Nw&ixlib=rb-4.0.3&q=80&w=1080", "https://images.unsplash.com/photo-1677227812556-77006b64b2a6?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTY4MDM5NzAzNA&ixlib=rb-4.0.3&q=80&w=1080", "https://images.unsplash.com/photo-1678004668997-a1d587d104c4?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTY4MDM5NzAzNg&ixlib=rb-4.0.3&q=80&w=1080", "https://images.unsplash.com/photo-1679957838736-06265db4d121?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTY4MDM5NzAzOA&ixlib=rb-4.0.3&q=80&w=1080", "https://images.unsplash.com/photo-1677939968019-32cda37fd8e4?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTY4MDM5NzA0Ng&ixlib=rb-4.0.3&q=80&w=1080", "https://images.unsplash.com/photo-1677939968019-32cda37fd8e4?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTY4MDM5NzA0OA&ixlib=rb-4.0.3&q=80&w=1080", "https://images.unsplash.com/photo-1679458118212-757e8436dc46?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTY4MDM5ODY0Mg&ixlib=rb-4.0.3&q=80&w=1080", "https://images.unsplash.com/photo-1679599767344-d28d47771cdd?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwxfDB8MXxyYW5kb218MHx8fHx8fHx8MTY4MDM5ODY0OA&ixlib=rb-4.0.3&q=80&w=1080"];
        string[10] memory descriptions = ["Paisaje anaranjado", "Sierras en el verano", "Construccion moderna", "Ciudad industrial", "Selfie en la barda", "Bosque desde arriba", "Lavanda en primer plano", "Barco arrivando a la ciudad", "Tienda moderna de ropa", "Palmeras desde el suelo"];

        for(uint i=0; i<imageUrls.length; i++) {
            images[imageUrls[i]].url = imageUrls[i];
            images[imageUrls[i]].owner = usersAddresses[i];
            images[imageUrls[i]].description = descriptions[i];
            images[imageUrls[i]].uploadDate = block.timestamp + i*3600;
            images[imageUrls[i]].isVotationOpen = i%2 == 0;
            images[imageUrls[i]].assignedVoters = _getRandomSubset(usersAddresses, 5);
            images[imageUrls[i]].positiveVotes = _getRandomSubset(usersAddresses, i%5);
            images[imageUrls[i]].negativeVotes =_getRandomSubset(usersAddresses, 5-i%5);
            images[imageUrls[i]].comments.push(Comment(usersAddresses[i], descriptions[i]));
        }
    }

    function arrayContains(address[] memory array, address value) private pure returns (bool) {
        for (uint256 i = 0; i < array.length; i++)
            if (array[i] == value)
                return true;
        return false;
    }

    constructor(address _pohAddress) public {
        proofOfHumanity = IProofOfHumanity(_pohAddress);
        ownerAddress = msg.sender;
    }

    /* ---------------------------------- AUTHENTICATION ---------------------------------- */

    function _validateIdentity(address _user) private view returns (bool) {
        return proofOfHumanity.isRegistered(_user);
    }

    function registerUser() public {
        require(!arrayContains(usersAddresses, msg.sender), "User is already registered");

        require(_validateIdentity(msg.sender), "User is not registered on Proof of Humanity.");

        usersAddresses.push(msg.sender);

        users[msg.sender]._address = msg.sender;
        users[msg.sender].name = proofOfHumanity.getRealName(msg.sender);
        users[msg.sender].profilePicUrl = '';
        users[msg.sender].tokens = STARTING_TOKENS;
        users[msg.sender].validatorReputation = 0;
        users[msg.sender].creatorReputation = 0;
    }

    /* ---------------------------------- USER LISTING ---------------------------------- */

    function getAllUsers() public view returns (User[] memory) {
        User[] memory finalResult = new User[](usersAddresses.length);

        for (uint256 i = 0; i < usersAddresses.length; i++)
            finalResult[i] = users[usersAddresses[i]];

        return finalResult;
    }

    function getUserByAddress(address _address) public view returns (User memory) {
        return users[_address];
    }    

    /* ---------------------------------- IMAGE LISTING ---------------------------------- */

    function getAllImages() public view returns (Image[] memory) {
        Image[] memory finalResult = new Image[](imageUrls.length);

        for (uint256 i = 0; i < imageUrls.length; i++)
            finalResult[i] = images[imageUrls[i]];

        return finalResult;
    }

    function getImagesByOwningUser(address _address) public view returns (Image[] memory) {
        string[] memory result = new string[](imageUrls.length);

        uint count = 0;
        for (uint i = 0; i < imageUrls.length; i++)
            if (images[imageUrls[i]].owner == _address)
                result[count++] = imageUrls[i];

        Image[] memory finalResult = new Image[](count);
        for (uint256 i = 0; i < count; i++)
            finalResult[i] = images[result[i]];

        return finalResult;
    }

    function getImagesByAssignedUser(address _address) public view returns (Image[] memory) {
        string[] memory result = new string[](imageUrls.length);

        uint count = 0;
        for (uint i = 0; i < imageUrls.length; i++)
            if (arrayContains(images[imageUrls[i]].assignedVoters, _address))
                result[count++] = imageUrls[i];

        Image[] memory finalResult = new Image[](count);
        for (uint256 i = 0; i < count; i++)
            finalResult[i] = images[result[i]];

        return finalResult;
    }

    function getImageByUrl(string memory _url) public view returns (Image memory) {
        return images[_url];
    }

    /* ---------------------------------- IMAGE VOTING ---------------------------------- */

    function voteImage(string memory _url, Vote _vote) public {
        require(images[_url].assignedVoters.length != 0, "Image doesnt exist");

        require(arrayContains(images[_url].assignedVoters, msg.sender), "Voter not allowed");

        require(!arrayContains(images[_url].positiveVotes, msg.sender) && !arrayContains(images[_url].negativeVotes, msg.sender),
             "Already voted");

        require(images[_url].isVotationOpen, "Voting closed");

        require(users[msg.sender].tokens > VOTE_COST, "Not enough tokens");

        users[msg.sender].tokens -= VOTE_COST;

        if(_vote == Vote.POSITIVE)
            images[_url].positiveVotes.push(msg.sender);
        else
            images[_url].negativeVotes.push(msg.sender);

        if(images[_url].positiveVotes.length + images[_url].negativeVotes.length == MAX_VOTERS)
            _closeVotation(_url);
    }

    function _closeVotation(string memory _url) public {
        images[_url].isVotationOpen = false;

        bool imageIsTrue = images[_url].positiveVotes.length > images[_url].negativeVotes.length;

        for (uint i = 0; i < images[_url].positiveVotes.length; i++) {
            address voterAdd = images[_url].positiveVotes[i];
            if(imageIsTrue) {
                users[voterAdd].tokens += VERIFY_REWARD;
                users[voterAdd].validatorReputation += 1;
            }
        }

        for (uint i = 0; i < images[_url].negativeVotes.length; i++) {
            address voterAdd = images[_url].positiveVotes[i];
            if(!imageIsTrue) {
                users[voterAdd].tokens += VERIFY_REWARD;
                users[voterAdd].validatorReputation += 1;
            }
        }

        users[images[_url].owner].creatorReputation += 1;
    }

    /* ---------------------------------- IMAGE COMMENTING ---------------------------------- */

    function commentImage(string memory _url, string memory _comment) public {
        require(images[_url].assignedVoters.length != 0, "Image doesnt exist");

        require(images[_url].isVotationOpen, "Voting closed");

        images[_url].comments.push(Comment(msg.sender, _comment));
    }    

    /* ---------------------------------- IMAGE PUBLISHING ---------------------------------- */

    function publishImage(string memory _url, string memory _desc) public {
        require(users[msg.sender].tokens > PUBLISH_COST, "Not enough tokens");

        users[msg.sender].tokens -= PUBLISH_COST;

        imageUrls.push(_url);

        images[_url].url = _url;
        images[_url].owner = msg.sender;
        images[_url].description = _desc;
        images[_url].uploadDate = block.timestamp;
        images[_url].isVotationOpen = true;
        images[_url].assignedVoters = _getRandomSubset(usersAddresses, ASSIGNED_VOTERS);
    }

    function unpublishAllImages() public {
        for(uint c=0; c<imageUrls.length; c++)
            delete images[imageUrls[c]];
        delete imageUrls;
    }

    /* ---------------------------------- TOKEN MANAGEMENT ---------------------------------- */

    function addTokens(address _userAddress, uint amount) public {
        require(msg.sender == ownerAddress, "Only owner can mint tokens");
        users[_userAddress].tokens += amount;
    }

    function transferTokens(address _destinyAddress, uint amount) public {
        require(users[msg.sender].tokens > amount, "Not enough tokens");
        users[msg.sender].tokens -= amount;
        users[_destinyAddress].tokens += amount;
    }

}
